import React from 'react'
import './project.css';
import projectImg from '../../assets/projectImg.jpg'


function Project() {
  return (
    <section id='projectPage'>
      <div id="project">
        <h1 className='projectTitle'>Project</h1>
      </div>
      <div className="projectContent">
        <img src="{projectImg}" alt="image" className='projectImg'/>
      </div>
    </section>
  )
}

export default Project
